import React from 'react';
import { Link } from 'react-router-dom';

const newProduct = () => {
    return (
        <tbody>
            <tr>
                <th scope="row">title here</th>
                <td>price here</td>
                <td>
                    <p>description here</p>
                </td>
                <td>
                    <img src="" width="50px" height="50px" alt="" />
                </td>
                <td>
                    <Link to="edit-col"> <button className="btn btn-primary">Edit</button></Link>
                    <Link to="delete-col"><button className="btn btn-danger">Delete</button></Link>
                </td>
            </tr>
        </tbody>
    );
}

export default newProduct;
